    https://api.yelp.com/v3/businesses/search?location=NYC`, {
        headers: {

            Authorization: `Bearer ${process.env.REACT_APP_API_KEY}`

        }, params: {
            location: 'NYC',
            categories: 'mexican'

        }}).then((res) => {
            console.log(res)
        }).catch((err) => {
